const CartItem = (item , itemIndex) => {
  return(
    <div>

      <div>
        <img src={item.image} />
      </div>
      <div>
        <h1> {item.title} </h1>
        <h1> {item.desc} </h1>
      </div>

    </div>
  )
};

export default CartItem;
